//////////////////////////////////////////////////////////////////////
// Function name	: CListOfRoots::CompareItem
// Description	    : Compara la lista de la palabra con el array estático
// Return type		: int   posicion en el array estático -1 si no casa
//////////////////////////////////////////////////////////////////////

int CListOfRoots::CompareItem()
    {
    int iSize = m_iSizeItem; // tamaño contando el elemento de retorno
    iSize++;
    STranslationString *ptrList = GetArrayPos(m_iSizeItem); // lista de arreglo segun el tamaño

    ASSERT(ptrList != NULL);

//    for(int j = 0; ptrList != NULL && strlen(ptrList[j].m_sType) > 0; j += iSize)
    for(int j = 0; ptrList != NULL && ptrList[j].m_sType[0] != 0; j += iSize)
        {
        bool bOk = true;

        for(int i = 0; i < m_iSizeItem && bOk == true; i++)
            {
            STranslationString *ArrayItem = GetArrayItem(i);
            if(strcmp(ArrayItem->m_sType,ptrList[j+i].m_sType) 
                || ArrayItem->m_Number != ptrList[j+i].m_Number 
                || ArrayItem->m_Degree != ptrList[j+i].m_Degree 
                || ArrayItem->m_Person != ptrList[j+i].m_Person
                || ArrayItem->m_Mode != ptrList[j+i].m_Mode
                || ArrayItem->m_Time != ptrList[j+i].m_Time)
                bOk = false;
          }
        if(bOk == true)
            return j;
      }
    return -1;
  }

//////////////////////////////////////////////////////////////////////
// 
//////////////////////////////////////////////////////////////////////

bool CListOfRoots::GetData()
    {
    int iPos = CompareItem();
    if(iPos != -1)
        {
        STranslationString *ptrList = GetArrayPos(m_iSizeItem);

        m_ptrWord->m_sTipo = ptrList[iPos+m_iSizeItem].m_sType;
        m_ptrWord->m_Genero = (Genero)ptrList[iPos+m_iSizeItem].m_Gender;
        m_ptrWord->m_Numero = (Numero)ptrList[iPos+m_iSizeItem].m_Number;
        m_ptrWord->m_Persona = (Persona)ptrList[iPos+m_iSizeItem].m_Person;
        m_ptrWord->m_Tiempo = (Tiempo)ptrList[iPos+m_iSizeItem].m_Time;
        m_ptrWord->m_Modo = (Modo)ptrList[iPos+m_iSizeItem].m_Mode;
        m_ptrWord->m_Plural = (bool)((Numero)(ptrList[iPos+m_iSizeItem].m_NounNumber)==PLURAL)?true:false;

        if(m_ptrWord->m_sTipo.GetLength() == 2)
            return GetTranslation();
      }
    return false;
  }

//////////////////////////////////////////////////////////////////////
// 
//////////////////////////////////////////////////////////////////////
bool CListOfRoots::GetTranslation()
    {
    CStrArray array;
    int iCant = GetRootCount(&array);

    switch(iCant)
        {
        case 1:     // tiene una sola traducción ejemplo SP
            {
            CStringA sKey,sData;
            sKey = array.GetAt(0);
            if(sKey.Find('|') == -1)
                {
                VERIFY(GetMainDict()->GetKey(sKey,sData));
                m_ptrWord->m_Key = sKey;
                CStringA sTmpData;
                GetSubCampo(sTmpData,sData,'E','#');
                CStringA sTmpType;
                GetSubCampo(sTmpType,sData,'T','#');
                m_ptrWord->m_Data = sTmpData;
                }
            break;
          }
        case 2:
            {
            CStringA sKey1,sData1;
            CStringA sKey2,sData2;
            sKey1 = array.GetAt(0);
            sKey2 = array.GetAt(1);
            VERIFY(GetMainDict()->GetKey(sKey1,sData1));
            VERIFY(GetMainDict()->GetKey(sKey2,sData2));
            CStringA sTmpData1;
            CStringA sTmpData2;
            GetSubCampo(sTmpData1,sData1,'E','#');
            GetSubCampo(sTmpData2,sData2,'E','#');
            CStringA sTmpType1;
            CStringA sTmpType2;
            GetSubCampo(sTmpType1,sData1,'T','#');
            GetSubCampo(sTmpType2,sData2,'T','#');

            // caso de que los dos tipos sean simples
            if(sTmpData1.GetAt(0) != '(' && sTmpData2.GetAt(0) != '(' )
                m_ptrWord->m_Data.Format("(W=%s)?{%s}:{%s}",(LPCSTR)CS2SZ(sTmpType1),(LPCSTR)CS2SZ(sTmpData1),(LPCSTR)CS2SZ(sTmpData2));
            // en el caso del primero simple y el segundo complejo
            else if(sTmpData1.GetAt(0) != '(' && sTmpData2.GetAt(0) == '(' )
                m_ptrWord->m_Data.Format("(W=%s)?{%s}:%s",(LPCSTR)CS2SZ(sTmpType1),(LPCSTR)CS2SZ(sTmpData1),(LPCSTR)CS2SZ(sTmpData2));
            // en el caso del segundo simple y el primero complejo
            else if(sTmpData2.GetAt(0) != '(' && sTmpData1.GetAt(0) == '(' )
                m_ptrWord->m_Data.Format("(W=%s)?{%s}:%s",(LPCSTR)CS2SZ(sTmpType2),(LPCSTR)CS2SZ(sTmpData2),(LPCSTR)CS2SZ(sTmpData1));
            // en el caso del primero complejo y el segundo simple
            else
                {  // si los dos son tipos complejos 1ro busco cual de los dos tiene una llave igual a la palabra original para poner primero el sust o adj que mas se parece
                if(sKey1 == m_ptrWord->m_Orig || sKey1 == m_ptrWord->m_Origlwr )
                    {
                    if(sTmpType1 == "XJ")
                        {
                        m_ptrWord->m_Data = sTmpData1;
                        m_ptrWord->m_Data.Replace(":",":(W=AA)?");
                        m_ptrWord->m_Data += ":";
                        m_ptrWord->m_Data += sTmpData2;
                        }
                    else if(sTmpType1 == "VV")
                        {
                        m_ptrWord->m_Data = sTmpData1;
                        m_ptrWord->m_Data.Replace(":",":(W=VI)?");
                        m_ptrWord->m_Data += ":";
                        m_ptrWord->m_Data += sTmpData2;
                        }
                    else if(sTmpType1 == "XK" || sTmpType1 == "XM" || sTmpType1 == "XY" || sTmpType1 == "XH")
                        {
                        m_ptrWord->m_Data = sTmpData1;
                        m_ptrWord->m_Data.Replace(":{",":(W=DD)?{");
                        m_ptrWord->m_Data += ":";
                        m_ptrWord->m_Data += sTmpData2;
                        }
                    else
                        {
                        m_ptrWord->m_Data.Format("(W=%s)?{%s}:%s",(LPCSTR)CS2SZ(sTmpType2),(LPCSTR)CS2SZ(sTmpData2),(LPCSTR)CS2SZ(sTmpData1));
                        }
                    }
                else if(sKey2 == m_ptrWord->m_Orig || sKey2 == m_ptrWord->m_Origlwr )
                    {
                    if(sTmpType2 == "XJ")
                        {
                        m_ptrWord->m_Data = sTmpData2;
                        m_ptrWord->m_Data.Replace(":",":(W=AA)?");
                        m_ptrWord->m_Data += ":";
                        m_ptrWord->m_Data += sTmpData1;
                        }
                    if(sTmpType2 == "VV")
                        {
                        m_ptrWord->m_Data = sTmpData2;
                        m_ptrWord->m_Data.Replace(":",":(W=VI)?");
                        m_ptrWord->m_Data += ":";
                        m_ptrWord->m_Data += sTmpData1;
                        }
                    else if(sTmpType2 == "XK" || sTmpType2 == "XM" || sTmpType2 == "XY" || sTmpType2 == "XH")
                        {
                        m_ptrWord->m_Data = sTmpData2;
                        m_ptrWord->m_Data.Replace(":{",":(W=DD)?{");
                        m_ptrWord->m_Data += ":";
                        m_ptrWord->m_Data += sTmpData1;
                        }
                    else
                        {
                        m_ptrWord->m_Data.Format("(W=%s)?{%s}:%s",(LPCSTR)CS2SZ(sTmpType2),(LPCSTR)CS2SZ(sTmpData2),(LPCSTR)CS2SZ(sTmpData1));
                        }
                    }
                else if(sTmpType1 == "XJ")
                    {
                    m_ptrWord->m_Data = sTmpData1;
                    m_ptrWord->m_Data.Replace(":",":(W=AA)?");
                    m_ptrWord->m_Data += ":";
                    m_ptrWord->m_Data += sTmpData2;
                    }
                else if(sTmpType1 == "VV")
                    {
                    m_ptrWord->m_Data = sTmpData1;
                    m_ptrWord->m_Data.Replace(":",":(W=VI)?");
                    m_ptrWord->m_Data += ":";
                    m_ptrWord->m_Data += sTmpData2;
                    }
                else if(sTmpType1 == "XK" || sTmpType1 == "XM" || sTmpType1 == "XY" || sTmpType1 == "XH")
                    {
                    m_ptrWord->m_Data = sTmpData1;
                    m_ptrWord->m_Data.Replace(":{",":(W=DD)?{");
                    m_ptrWord->m_Data += ":";
                    m_ptrWord->m_Data += sTmpData2;
                    }
                else if(sTmpType2 == "XJ")
                    {
                    m_ptrWord->m_Data = sTmpData2;
                    m_ptrWord->m_Data.Replace(":",":(W=AA)?");
                    m_ptrWord->m_Data += ":";
                    m_ptrWord->m_Data += sTmpData1;
                    }
                else if(sTmpType2 == "VV")
                    {
                    m_ptrWord->m_Data = sTmpData2;
                    m_ptrWord->m_Data.Replace(":",":(W=VI)?");
                    m_ptrWord->m_Data += ":";
                    m_ptrWord->m_Data += sTmpData1;
                    }
                else if(sTmpType2 == "XK" || sTmpType2 == "XM" || sTmpType2 == "XY" || sTmpType2 == "XH")
                    {
                    m_ptrWord->m_Data = sTmpData2;
                    m_ptrWord->m_Data.Replace(":{",":(W=DD)?{");
                    m_ptrWord->m_Data += ":";
                    m_ptrWord->m_Data += sTmpData1;
                    }
                else
                    {
                    m_ptrWord->m_Data.Format("(W=%s)?{%s}:%s",(LPCSTR)CS2SZ(sTmpType2),(LPCSTR)CS2SZ(sTmpData2),(LPCSTR)CS2SZ(sTmpData1));
                    }
                }
            m_ptrWord->m_Key = sKey1;
            break;
          }
        case 3:
            {
            CStringA sKey1,sData1;
            CStringA sKey2,sData2;
            CStringA sKey3,sData3;

            sKey1 = array.GetAt(0);
            sKey2 = array.GetAt(1);
            sKey3 = array.GetAt(2);

            VERIFY(GetMainDict()->GetKey(sKey1,sData1));
            VERIFY(GetMainDict()->GetKey(sKey2,sData2));
            VERIFY(GetMainDict()->GetKey(sKey3,sData3));
            CStringA sTmpData1;
            CStringA sTmpData2;
            CStringA sTmpData3;
            GetSubCampo(sTmpData1,sData1,'E','#');
            GetSubCampo(sTmpData2,sData2,'E','#');
            GetSubCampo(sTmpData3,sData3,'E','#');
            CStringA sTmpType1;
            CStringA sTmpType2;
            CStringA sTmpType3;
            GetSubCampo(sTmpType1,sData1,'T','#');
            GetSubCampo(sTmpType2,sData2,'T','#');
            GetSubCampo(sTmpType3,sData3,'T','#');

            // caso de que los tres tipos sean simples
            if(sTmpData1.GetAt(0) != '(' && sTmpData2.GetAt(0) != '(' && sTmpData3.GetAt(0) != '(')
                m_ptrWord->m_Data.Format("(W=%s)?{%s}:(W=%s)?{%s}:{%s}",(LPCSTR)CS2SZ(sTmpType1),(LPCSTR)CS2SZ(sTmpData1),(LPCSTR)CS2SZ(sTmpType2),(LPCSTR)CS2SZ(sTmpData2),(LPCSTR)CS2SZ(sTmpData3));
            // en el caso del primero simple, el segundo simple y  el tercero complejo
            else if(sTmpData1.GetAt(0) != '(' && sTmpData2.GetAt(0) != '(' && sTmpData3.GetAt(0) == '(' )
                m_ptrWord->m_Data.Format("(W=%s)?{%s}:(W=%s)?{%s}:%s",(LPCSTR)CS2SZ(sTmpType1),(LPCSTR)CS2SZ(sTmpData1),(LPCSTR)CS2SZ(sTmpType2),(LPCSTR)CS2SZ(sTmpData2),(LPCSTR)CS2SZ(sTmpData3));
            // en el caso del primero simple, el segundo complejo y  el tercero simple
            else if(sTmpData1.GetAt(0) != '(' && sTmpData2.GetAt(0) == '(' && sTmpData3.GetAt(0) != '(' )
                m_ptrWord->m_Data.Format("(W=%s)?{%s}:(W=%s)?{%s}:%s",(LPCSTR)CS2SZ(sTmpType1),(LPCSTR)CS2SZ(sTmpData1),(LPCSTR)CS2SZ(sTmpType3),(LPCSTR)CS2SZ(sTmpData3),(LPCSTR)CS2SZ(sTmpData2));
            // en el caso del primero complejo, el segundo simple y  el tercero simple
            else if(sTmpData1.GetAt(0) == '(' && sTmpData2.GetAt(0) != '(' && sTmpData3.GetAt(0) != '(' )
                m_ptrWord->m_Data.Format("(W=%s)?{%s}:(W=%s)?{%s}:%s",(LPCSTR)CS2SZ(sTmpType2),(LPCSTR)CS2SZ(sTmpData2),(LPCSTR)CS2SZ(sTmpType3),(LPCSTR)CS2SZ(sTmpData3),(LPCSTR)CS2SZ(sTmpData1));
            // en el caso del primero Simple y el segundo complejo y el tercero complejo
            else if(sTmpData1.GetAt(0) != '(' && sTmpData2.GetAt(0) == '(' && sTmpData3.GetAt(0) == '(' )
                {
                m_ptrWord->m_Data.Format("(W=%s)?{%s}:",(LPCSTR)CS2SZ(sTmpType1),(LPCSTR)CS2SZ(sTmpData1));

                CStringA tmpstr;
                if(sTmpType2 == "XJ")
                    {
                    tmpstr = sTmpData2;
                    tmpstr.Replace(":",":(W=AA)?");
                    tmpstr += ":";
                    tmpstr += sTmpData3;
                    m_ptrWord->m_Data += tmpstr;
                    }
                else if(sTmpType2 == "VV")
                    {
                    tmpstr = sTmpData2;
                    tmpstr.Replace(":",":(W=VI)?");
                    tmpstr += ":";
                    tmpstr += sTmpData3;
                    tmpstr += tmpstr;
                    }
                else if(sTmpType2 == "XK" || sTmpType2 == "XM" || sTmpType2 == "XY")
                    {
                    tmpstr = sTmpData2;
                    tmpstr.Replace(":",":(W=DD)?");
                    tmpstr += ":";
                    tmpstr += sTmpData3;
                    tmpstr += tmpstr;
                    }
                else if(sTmpType3 == "XJ")
                    {
                    tmpstr = sTmpData3;
                    tmpstr.Replace(":",":(W=AA)?");
                    tmpstr += ":";
                    tmpstr += sTmpData2;
                    m_ptrWord->m_Data += tmpstr;
                    }
                else if(sTmpType3 == "VV")
                    {
                    tmpstr = sTmpData3;
                    tmpstr.Replace(":",":(W=VI)?");
                    tmpstr += ":";
                    tmpstr += sTmpData2;
                    tmpstr += tmpstr;
                    }
                else if(sTmpType3 == "XK" || sTmpType3 == "XM" || sTmpType3 == "XY")
                    {
                    tmpstr = sTmpData3;
                    tmpstr.Replace(":",":(W=DD)?");
                    tmpstr += ":";
                    tmpstr += sTmpData2;
                    tmpstr += tmpstr;
                    }
                else m_ptrWord->m_Data.Format("(W=%s)?{%s}:(W=%s)?{%s}:%s",(LPCSTR)CS2SZ(sTmpType1),(LPCSTR)CS2SZ(sTmpData1),(LPCSTR)CS2SZ(sTmpType3),(LPCSTR)CS2SZ(sTmpData3),(LPCSTR)CS2SZ(sTmpData2));
                }
            else
                {
                if((sKey1 == m_ptrWord->m_Origlwr || sKey1 == m_ptrWord->m_Orig) && sTmpType1.IsEmpty() == false  && sTmpData1.IsEmpty() == false)
                    {
                    m_ptrWord->m_Data = sTmpData1;
                    m_ptrWord->m_sTipo = sTmpType1;
                  }
                else if((sKey2 == m_ptrWord->m_Origlwr || sKey2 == m_ptrWord->m_Orig) && sTmpType2.IsEmpty() == false  && sTmpData2.IsEmpty() == false)
                    {
                    m_ptrWord->m_Data = sTmpData2;
                    m_ptrWord->m_sTipo = sTmpType2;
                  }
                else if (sTmpType3.IsEmpty() == false && sTmpData3.IsEmpty() == false)
                    {
                    m_ptrWord->m_Data = sTmpData3;
                    m_ptrWord->m_sTipo = sTmpType3;
                  }
                //AfxMessageBox("No puedo resolver dos tipos complejos");
                ASSERT(m_ptrWord->m_Data.IsEmpty() == false);
              }
            m_ptrWord->m_Key = sKey1;
            break;
          }
        default:
            return false;
      }

    ConvertVerbs();
    return true;
  }

//////////////////////////////////////////////////////////////////////
//  Cuenta la cantidad de raices en el arreglo de palabras a la que
//  se redujo la palabra original
//////////////////////////////////////////////////////////////////////

int CListOfRoots::GetRootCount(CStrArray *ptrArray)
    {
    for(int i = 0/*,iCount = 0*/; i < m_iSizeItem; i++)
        {
        bool bEnArray = false;
        for(int j = 0; j < ptrArray->GetSize() && bEnArray == false; j++)
            {
            //if(!strcmp(ptrArray->GetAt(j),GetArrayItem(i)->m_sRoot))
            if(ptrArray->GetAt(j) == GetArrayItem(i)->m_sRoot)
                bEnArray = true;
          }
        if(bEnArray == false)
            ptrArray->Add(GetArrayItem(i)->m_sRoot);
      }
    ASSERT(ptrArray->GetSize() > 0);
    return ptrArray->GetSize();
  }

