//////////////////////////////////////////////////////////////////////
// Busca en la tabla y realiza la conversión
//////////////////////////////////////////////////////////////////////
void CListOfRoots::FindVerbConvertion(bool bTransitive)
    {
    for(int i = 0; strlen(VerbConvertion[i].m_VV) > 0; i++)
        {
        //if(!strcmp(m_ptrWord->m_sTipo,VerbConvertion[i].m_VV))
        if(m_ptrWord->m_sTipo == VerbConvertion[i].m_VV)
            {
            if(bTransitive == true && strlen(VerbConvertion[i].m_VT) == 2 )
				{
				if(m_ptrWord->m_sTipo == "VV" && m_ptrWord->m_Modo == mINDICATIVO && m_ptrWord->m_Persona == TERCERAP)
					m_ptrWord->m_sTipo = "HT";
				else
					m_ptrWord->m_sTipo = VerbConvertion[i].m_VT;
				}
            else if( bTransitive == true && strlen(VerbConvertion[i].m_VI) == 2 )
				{
				if(m_ptrWord->m_sTipo == "VV" && m_ptrWord->m_Modo == mINDICATIVO && m_ptrWord->m_Persona == TERCERAP)
					m_ptrWord->m_sTipo = "HI";
				else
	                m_ptrWord->m_sTipo = VerbConvertion[i].m_VI;
				}
            break;
          }
      }
  }

