// Convierte los verbos transitivos e intransitivos a solo transitivo
// o solo intransitivo de ser posible
//////////////////////////////////////////////////////////////////////

void CListOfRoots::ConvertVerbs()
    {
    CStrArray array;
    int iCant = GetRootCount(&array);

    bool bTransitivo = false;
    bool bIntransitivo = false;

    for(int i = 0; i < iCant; i++)
        {
        CStringA sKey(array.GetAt(i)),sData,sType;
        if(sKey.Find('|') == -1)
            {
            VERIFY(GetMainDict()->GetKey(sKey,sData));
            GetSubCampo(sType,sData,'T','#');
            if(sVerboT.Find(sType) != -1)
                bTransitivo = true;
            else if(sVerboI.Find(sType) != -1)
                bIntransitivo = true;
            }
      }
    if(bTransitivo == true && bIntransitivo == false)
        FindVerbConvertion(true);
    else if(bTransitivo == false && bIntransitivo == true)
        FindVerbConvertion(false);
  }

